                    <tr>
                        <td>{{ admin.id }}</td>
                        <td>{{ admin.username }}</td>
                        <td>{{ admin.email }}</td>
                        <td>{{ admin.phone }}</td>
                    </tr>
                {% endfor %}

                </tbody>
            </table>

        </div>

    </div>

